  const [posts, setPosts] = useState([])

  useEffect(async () => {
    const response = await PostService.getAll()
    const data = response.data
    setPosts(data)
  }, [])

  console.log(posts)
  return (
    <div className="App">
      <div className='board'>
        <div className='test'>

            {posts.map((post) => {
              return <Posts post={post}/>
            })}

        </div>
      </div>
      <div className='board'>

      </div>
    </div>
  );
}

export default App;

